import Link from "next/link";

const LandingHeader = () => (
  <div className="landing">
    <div className="landing--wrapper">
      <h1>Woo Young Choi</h1>
      <p>Software engineer based in New York, NY.</p>
      <p>Specializing in building and designing websites and applications.</p>
    </div>
    <style jsx>
      {`
        .landing {
          color: #2699fb;
          display: flex;
          flex-direction: column;
          justify-content: center;
          height: 100px;
          align-items: center;
          min-height: 100vh;
          margin: 0 auto;
          font-family: "Georgia, serif";
          text-align: center;
          border: solid 3px blue;
        }

        landing--wrapper {
          margin: auto;
          border: solid 3px red;
        }

        h1 {
          font-size: 30px;
          font-weight: normal;
        }

        p {
          font-size: 15px;
        }
      `}
    </style>
  </div>
);

export default LandingHeader;
